import '../scss/main.scss';

const Information = () => {

    return (
        <section className='information'>
            <div className='wrapper'>
                <div className='information__container'>
                    <div className='information__text'>
                    <h1> O nas!</h1>
                        <p> Lorem Ipsum</p>
                    </div>
                </div>
            </div>
        </section>
    )
}

export default Information;
